import { Component, Input, OnInit } from '@angular/core';
import { DomSanitizer, SafeResourceUrl } from '@angular/platform-browser';
import { PdfViewerModule } from 'ng2-pdf-viewer';

@Component({
  selector: 'app-ng2-pdf-viewer',
  standalone: true,
  imports: [PdfViewerModule],
  templateUrl: './ng2-pdf-viewer.component.html',
  styleUrl: './ng2-pdf-viewer.component.css'
})
export class Ng2PdfViewerComponent implements OnInit {
  
  @Input() pdfURL : string = '';
  @Input() zoom_to : number = 1.0;
  @Input() pageVariable : number = 1;
  constructor(
    private sanitizer: DomSanitizer
    ) { }
  
    ngOnInit(): void {
      const base64PDF = "";
      
      this.createAndBindPdf(base64PDF);
  }

  createSafeUrl(url: string): SafeResourceUrl {
    return this.sanitizer.bypassSecurityTrustResourceUrl(url);
  }

  private createAndBindPdf(content: string): void {
    this.pdfURL = this.createUrlFromStringContent(content);
  }
  private createUrlFromStringContent(content: string): string {
    const text = content;
    const byteCharacters = window.atob(text);
    const byteNumbers = new Array(byteCharacters.length);
    for (let i = 0; i < byteCharacters.length; i++) {
      byteNumbers[i] = byteCharacters.charCodeAt(i);
    }
    const byteArray = new Uint8Array(byteNumbers);
    const blob = new Blob([byteArray], { type: 'application/pdf' });  
    return URL.createObjectURL(blob);  
  }

}
